import { IonGrid, IonRow, IonCol, IonButton, IonRouterLink, IonPage, IonContent } from '@ionic/react';
import React, { useState } from 'react';

import '../css/Global.css';
import '../css/ProgrammeTalks.css'

import TopNav from './TopNav';

const ProgTalkInfo: React.FC<{
    progTalk: string; 
    awardingUni: string;
    date: Date;
    time: string;
    venue: string;
}> = props => {

    const [venue, setVenue] = useState('');

    setVenue('BLK A');
    
    return (
        <IonPage>
            <TopNav title="Programme Talks" route="/u/openHouseMain/programmeTalks" backarrow={ true } hamburger={ true } />
        
            <IonContent>
                <IonGrid id="progTalkInfoGrid">
                    {/* Programme Talk */}
                    <IonRow>
                        <IonCol size-sizeSm="4" style={{background: "blue"}} className="progTalkInfoHeader">
                            Programme Talk:
                        </IonCol>

                        <IonCol size-sizeSm="8">
                            <div>
                                <p>{props.progTalk}</p>
                            </div>
                        </IonCol>
                    </IonRow>

                    {/* Awarding Uni */}
                    <IonRow>
                        <IonCol size-sizeSm="4" style={{background: "blue"}} className="progTalkInfoHeader">
                            Awarding University:
                        </IonCol>

                        <IonCol size-sizeSm="8">
                            <div>
                                <p>{props.progTalk}</p>
                            </div>
                        </IonCol>
                    </IonRow>

                    {/* Date */}
                    <IonRow>
                        <IonCol size-sizeSm="4" style={{background: "blue"}} className="progTalkInfoHeader">
                            Date:
                        </IonCol>

                        <IonCol size-sizeSm="8">
                            <div>
                                <p>{props.progTalk}</p>
                            </div>
                        </IonCol>
                    </IonRow>

                    {/* Time */}
                    <IonRow>
                        <IonCol size-sizeSm="4" style={{background: "blue"}} className="progTalkInfoHeader">
                            Time:
                        </IonCol>

                        <IonCol size-sizeSm="8">
                            <div>
                                <p>{props.progTalk}</p>
                            </div>
                        </IonCol>
                    </IonRow>

                    {/* Venue */}
                    <IonRow>
                        <IonCol size-sizeSm="4" style={{background: "blue"}} className="progTalkInfoHeader">
                            Venue:
                        </IonCol>

                        <IonCol size-sizeSm="8">
                            <div>
                                <p>{props.venue}</p>
                            </div>
                        </IonCol>
                    </IonRow>

                </IonGrid>
            </IonContent>
        </IonPage>
    );
};

export default ProgTalkInfo;
